import axios from 'axios';
import React from 'react'

const Pokemon = () => {

    const baseURL = 'https://pokeapi.co/api/v2/';
    axios.get(baseURL + 'pokemon/1')

    return (
        <div>
            <h1>Pokemon List</h1>
        </div>
    )
}
export default Pokemon;
